import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Route,NavLink,BrowserRouter as Router,Switch} from "react-router-dom";
import Plank from "../dashboard/Plank";
import Article from "../dashboard/Article";
import Notfound from "../dashboard/Notfound";


class Navbar extends Component {
    render() {
      return (

          <Router>
   <div style={{ height: "100vh"}} className="container">
      <ul>
          <li>
            <NavLink exact activeClassName="active" to="/">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/article">
              Article
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/plank">
             plank
            </NavLink>
          </li>
        </ul>
        <Switch>

          <Route path="/plank" component={Plank} />
          {/* <Route path="/article" component={} />
          <Route component={} /> */}
        </Switch>
        </div>
        </Router>
      );
    }
  }

export default Navbar;
